import React from "react";
import "../assets/styles/components/projectBar.css";

const ProjectBar = props => {
  return (
    <div className="projectBar">
      <div className="projectBar-group">
        <h3>Company</h3>
        <p>{props.company}</p>
      </div>
      <div className="projectBar-group">
        <h3>Client</h3>
        <p>{props.client}</p>
      </div>
      <div className="projectBar-group">
        <h3>Company</h3>
        <p>{props.company}</p>
      </div>
    </div>
  );
};

export default ProjectBar;
